                var host = hosts[i];
                // æ›´æ–°è¿›åº¦æç¤º
                java.longToast("ğŸ” æ£€æµ‹ä¸­ (" + (i+1) + "/" + total + ")");

                var latency = checkLatency(host);
                if (latency !== null) {
                    results.push({
                        host: host,
                        latency: latency
                    });
                }
            }

            var totalTime = getTimestamp() - totalStart;
            java.log("æ€»è€—æ—¶: " + totalTime + "ms");

            if (results.length === 0) {
                java.toast("âŒ æ— å¯ç”¨ä¸»æœº");
            } else {
                results.sort(function(a, b) {
                    return a.latency - b.latency;
                });

                var best = results[0];
                var summary = "âœ… å®Œæˆæ£€æµ‹\næœ€ä½³: " + best.host + "\nâ±ï¸ " + best.latency + "ms";
                java.longToast(summary);
